import React from 'react';
import { IonHeader, IonToolbar, IonButtons, IonTitle } from '@ionic/react';

import './index.css';

const scanDevices: React.FC = () => {
  return (
    <IonHeader>
      <IonToolbar color="--ion-color-step-200" class="main-toolbar">
        <IonTitle class="main-toolbar-title">Looking for devices...</IonTitle>
      </IonToolbar>
    </IonHeader>
  );
};

export default scanDevices;
